import './App.css';
import qs from 'qs';
import useFeedback from './api/useFeedback';
import { useState } from 'react';
import { useSearchParams } from 'react-router-dom';

function App() {
  const { postFeedback, isLoading } = useFeedback();
  const [experiences, setExperiences] = useState('');
  const [rating, setRating] = useState();

  const installationId = searchParams.get('installationId');


  const onSubmit = async (e) => {
    e.preventDefault();
    const data = qs.stringify({
      experience: experiences,
      rating: rating,
      installation_id: installationId,
    });

    try {
      await postFeedback(data);
      setRating(1);
      setExperiences('');
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <div className="font">
          <div className="rate">
            <p className="rate1">Rate your experience</p>
            <div className="rate2">
              <p className="rate3">
                {' '}
                Feedbacks are important to us, so please rate your experience
                and the service.{' '}
              </p>
            </div>

            <div className="rate2">
              <div className="pic">
                <img className="ah" src="images/a.png" alt="image1" />
              </div>
            </div>

            <form
              className="form-horizontal mt-2 col-12 col-md-12 p-5 rounded-2xl mb-10 "
              onSubmit={onSubmit}
            >
              <div className="how">
                <p className="how2">
                  1. How would you rate the engineer on site?
                </p>
                <div className="terrible">
                  <div className="terrible1">
                    <img
                      className="img"
                      src="images/terrible.png"
                      id="1"
                      onClick={(e) => setRating(1)}
                    ></img>
                    <p className="how2">Terrible</p>
                  </div>

                  <div className="bad">
                    <img
                      className="img"
                      src="images/bad.png"
                      alt="image1"
                      onClick={(e) => setRating(2)}
                    />
                    <p className="how2">Bad</p>
                  </div>

                  <div className=" bad">
                    <img
                      className="img"
                      src="images/average.png"
                      alt="image1"
                      onClick={(e) => setRating(3)}
                    />
                    <p className="how2">Average</p>
                  </div>

                  <div className=" bad">
                    <img
                      className="img"
                      src="images/verygood.png"
                      alt="image1"
                      onClick={(e) => setRating(4)}
                    />
                    <p className="how2">Very good</p>
                  </div>

                  <div className="bad">
                    <img
                      className=" img"
                      src="images/excellent.png"
                      alt="image1"
                      onClick={(e) => setRating(5)}
                    />
                    <p className="how2">Excellent</p>
                  </div>
                </div>
                <p className="kind">
                  2. Kindly share your experience concerning the installation
                  process.
                </p>

                <textarea
                  type="text"
                  name="experience"
                  onChange={(e) => setExperiences(e.target.value)}
                  value={experiences}
                  className="please"
                >
                  {' '}
                  Please share your experience.
                </textarea>

                <p className="text">
                  <a href="#">
                    {' '}
                    <button className="submit" type="submit">
                      {' '}
                      Submit{' '}
                    </button>{' '}
                  </a>
                </p>
              </div>
            </form>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
